function reducer(state = initialState, action) {
  switch (action.type) {
    case SET_SEARCH_RESULTS: {
      return {
        ...state,
        searchResults: action.payload,
      };
    }

    case SELECT_ITEM: {
      return {
        ...state,
        selectedItem: action.payload,
      };
    }

    default:
      return state;
  }
}

export default reducer;
